package three_kyu.test;

import org.junit.Test;
import three_kyu.Fibonacci;

import java.math.BigInteger;

import static org.junit.Assert.*;

public class FibonacciTest {

    @Test
    public void testInputZero() {
        assertEquals(BigInteger.ZERO, Fibonacci.fib(BigInteger.ZERO));
    }

    @Test
    public void testInputOne() {
        assertEquals(BigInteger.ONE, Fibonacci.fib(BigInteger.ONE));
    }

    @Test
    public void testInputTwo() {
        assertEquals(BigInteger.valueOf(1), Fibonacci.fib(BigInteger.valueOf(2)));
    }

    @Test
    public void testInputThree() {
        assertEquals(BigInteger.valueOf(2), Fibonacci.fib(BigInteger.valueOf(3)));
    }

    @Test
    public void testInputSeven() {
        assertEquals(BigInteger.valueOf(13), Fibonacci.fib(BigInteger.valueOf(7)));
    }

    @Test
    public void testInputBFnumber() {
        StringBuilder stringBuilder = new StringBuilder();
        stringBuilder.append("");
        stringBuilder.append("");
        stringBuilder.append("");
        stringBuilder.append("");
        stringBuilder.append("");
        stringBuilder.append("");
        stringBuilder.append("");
        assertEquals(new BigInteger(stringBuilder.toString()), Fibonacci.fib(BigInteger.valueOf(1_375_906)));
    }

}